import { TokenPocketWalletAdapter } from './adapter';
export const TokenPocketWalletName = 'TokenPocket';
export const getTokenPocketWallet = (config = {}) => ({
    name: TokenPocketWalletName,
    url: 'https://tokenpocket.pro',
    icon: 'data:image/svg+xml;base64,',
    adapter: new TokenPocketWalletAdapter(config),
});
//# sourceMappingURL=wallet.js.map
